import request, { IResult, ResponseError } from "./utils";

export async function getMenuElements() {
  const requestURL = "http://localhost:1337/api/menus";
  try {
    let result: IResult | { err: ResponseError } = await request(requestURL, {
      method: "GET",
    });
    if (typeof result === IResult) return result;
  } catch (e) {
    console.error(e);
  }
}
